          summary:
            'Lift Your Skinny Fists Like Antennas to Heaven (also known as Lift Yr. Skinny Fists Like Antennas to Heaven! and Levez Vos Skinny Fists Comme Antennas to Heaven) is the second studio album by Canadian post-rock group Godspeed You! Black Emperor, released in 2000 as a double album.\n\nThe four tracks on Lift Your Skinny Fists Like Antennas to Heaven are composed of individually named internal movements. The whole album is instrumental, except for sampled voice inserts. <a href="http://www.last.fm/music/Godspeed+You%21+Black+Emperor/Lift+Your+Skinny+Fists+Like+Antennas+to+Heaven">Read more on Last.fm</a>.',
          content:
            'Lift Your Skinny Fists Like Antennas to Heaven (also known as Lift Yr. Skinny Fists Like Antennas to Heaven! and Levez Vos Skinny Fists Comme Antennas to Heaven) is the second studio album by Canadian post-rock group Godspeed You! Black Emperor, released in 2000 as a double album.\n\nThe four tracks on Lift Your Skinny Fists Like Antennas to Heaven are composed of individually named internal movements. The whole album is instrumental, except for sampled voice inserts. The samples on the album are often used to send some satirical or political message. The inner panels of the vinyl edition released by Constellation contain a diagram used to illustrate the relative lengths of movements within the four tracks; each movement is drawn by Efrim Menuck,[1] as a rectangular block with its length determined by the proportion of the track it comprises. Some of the blocks are shifted slightly upwards to show an increase in intensity. The movement title and the numerical length are denoted either above or below the square. The same diagram is provided as a paper insert in the CD edition from Kranky.\n\nThe inside cover drawings were taken from William Schaff\'s "Notes to a Friend; Silently Listening No. 2", and the cover was a redrawn version of one of the pieces on "Notes to a Friend", by John Arthur Tinholt. The flip side of the vinyl contains various images taken by the band. <a href="http://www.last.fm/music/Godspeed+You%21+Black+Emperor/Lift+Your+Skinny+Fists+Like+Antennas+to+Heaven">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
