        wiki: {
          published: '04 Jan 2013, 01:58',
          summary:
            'Since I Left You is the debut studio album by Australian electronic dance music group The Avalanches, which was released on 27 November 2000. Produced by The Avalanches\' members Robbie Chater and Darren Seltmann (under the pseudonym Bobbydazzler), it was issued on Modular Recordings. The album was created in two separate near-identical studios by Chater and Seltmann, passing audio mixes of records they sampled. The album contains about 3500 vinyl samples of various genres of music. <a href="http://www.last.fm/music/The+Avalanches/Since+I+Left+You">Read more on Last.fm</a>.',
          content:
            'Since I Left You is the debut studio album by Australian electronic dance music group The Avalanches, which was released on 27 November 2000. Produced by The Avalanches\' members Robbie Chater and Darren Seltmann (under the pseudonym Bobbydazzler), it was issued on Modular Recordings. The album was created in two separate near-identical studios by Chater and Seltmann, passing audio mixes of records they sampled. The album contains about 3500 vinyl samples of various genres of music. As it was not originally intended for international release, the duo did not worry about copyright restrictions nor attempt to keep track of which samples they would need to clear.\n\nAfter the album\'s positive reception in Australia, the duo considered an international release – its date was held back until 2001 in both the United Kingdom and North America and appeared in slightly altered forms. The delay and changes occurred so that the group could obtain permission to use the samples or use replacements. Five singles were spawned by the album, "Electricity", "Frontier Psychiatrist", "Since I Left You", "Radio" and "A Different Feeling". The group promoted the album by organising headlining tours in Australia, Europe and the United States. Since I Left You was issued to favourable reception, it peaked in the top 30 on the ARIA Albums Chart, number 12 in Norway, number eight on the UK Album Charts and, in the United States, at number ten on the Top Electronic Albums chart and in the top 40 on the Top Heatseekers chart. At the ARIA Music Awards of 2001 it won in three categories: Breakthrough Artist – Album and Best Dance Release, Producer of the Year for Bobbydazzler. The Avalanches won a fourth award, Breakthrough Artist – Single for "Frontier Psychiatrist". Since I Left You became one of the best reviewed albums of the 2000s. In October 2010, it was listed at No. 10 in the book, 100 Best Australian Albums. <a href="http://www.last.fm/music/The+Avalanches/Since+I+Left+You">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
        },
