        wiki: {
          published: '08 Aug 2008, 02:57',
          summary:
            'Deathconsciousness is the debut studio album by American post-punk band Have a Nice Life, released on January 1, 2008 on Enemies List Home Recordings. The album is a double album; the first disc is entitled "The Plow That Broke the Plains", the second one entitled "The Future". The album was reissued in 2009 by Enemies List, re-pressing the album on vinyl and CD, with new cover art. The reissue included a 70-page booklet with various paintings and lyrics. <a href="http://www.last.fm/music/Have+a+Nice+Life/Deathconsciousness">Read more on Last.fm</a>.',
          content:
            'Deathconsciousness is the debut studio album by American post-punk band Have a Nice Life, released on January 1, 2008 on Enemies List Home Recordings. The album is a double album; the first disc is entitled "The Plow That Broke the Plains", the second one entitled "The Future". The album was reissued in 2009 by Enemies List, re-pressing the album on vinyl and CD, with new cover art. The reissue included a 70-page booklet with various paintings and lyrics. The album has gained a substantial cult following in recent years as a result of its bleak subject matter and lo-fi production. Another reissue of the double-album was released September 17, 2014 by Enemies List and The Flenser.\n\nThe album cover is a cropped version of the Jacques-Louis David painting, La Mort de Marat (English: The Death of Marat), which documents the death of French revolutionary leader Jean-Paul Marat.\n\nAll tracks written by Dan Barrett and Tim Macuga.\n\nDigital copies include the artwork, as well as the booklet in PDF format. www.enemieslist.net.\n <a href="http://www.last.fm/music/Have+a+Nice+Life/Deathconsciousness">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
        },
