          summary:
            'Rubber Soul is the sixth studio album by the English rock band the Beatles. It was released on 3 December 1965 in the United Kingdom, on EMI\'s Parlophone label, accompanied by the non-album double A-side single "Day Tripper" / "We Can Work It Out".\n\nThe songs demonstrate the Beatles\' increasing maturity as lyricists and, in their incorporation of brighter guitar tones and new instrumentation such as sitar, harmonium and fuzz bass, the group striving for more expressive sounds and arrangements for their music. <a href="http://www.last.fm/music/The+Beatles/Rubber+Soul+(Remastered)">Read more on Last.fm</a>.',
          content:
            'Rubber Soul is the sixth studio album by the English rock band the Beatles. It was released on 3 December 1965 in the United Kingdom, on EMI\'s Parlophone label, accompanied by the non-album double A-side single "Day Tripper" / "We Can Work It Out".\n\nThe songs demonstrate the Beatles\' increasing maturity as lyricists and, in their incorporation of brighter guitar tones and new instrumentation such as sitar, harmonium and fuzz bass, the group striving for more expressive sounds and arrangements for their music.\n\nRubber Soul was highly influential on the Beatles\' peers, leading to a widespread focus away from singles and onto creating albums of consistently high-quality songs. It has been recognised by music critics as an album that opened up the possibilities of pop music in terms of lyrical and musical scope, and as a key work in the creation of styles such as psychedelia and progressive rock. <a href="http://www.last.fm/music/The+Beatles/Rubber+Soul+(Remastered)">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
