          summary:
            'If You\'re Feeling Sinister is the second album by Scottish pop group Belle & Sebastian, released on the independent label Jeepster Records in the United Kingdom and Matador Records in the United States. The album was released to much critical praise in 1996. Band leader Stuart Murdoch has stated in interviews that this is probably his best collection of songs, although they are not very well recorded. In 2005, Belle & Sebastian released a live version <a href="http://www.last.fm/music/Belle+and+Sebastian/If+You%27re+Feeling+Sinister">Read more on Last.fm</a>.',
          content:
            'If You\'re Feeling Sinister is the second album by Scottish pop group Belle & Sebastian, released on the independent label Jeepster Records in the United Kingdom and Matador Records in the United States. The album was released to much critical praise in 1996. Band leader Stuart Murdoch has stated in interviews that this is probably his best collection of songs, although they are not very well recorded. In 2005, Belle & Sebastian released a live version of the album entitled If You\'re Feeling Sinister: Live at the Barbican on the iTunes Music Store. If You\'re Feeling Sinister has received wide acclaim. Pitchfork Media placed the album at number 14 in its top 100 albums of the 1990s. Later, the readers of Pitchfork named the album as the 31st greatest album since the website launched in 1996. Rolling Stone featured the album at number 75 on its list of "100 Best Albums of the Nineties," while Spin included the record at number 59 on its "125 Best Albums of the Past 25 Years" list. <a href="http://www.last.fm/music/Belle+and+Sebastian/If+You%27re+Feeling+Sinister">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
