        wiki: {
          published: '24 Oct 2012, 22:48',
          summary:
            'Tigermilk is the 1996 debut album from Scottish pop group Belle & Sebastian. Originally given a limited release (1,000 copies) by Electric Honey, the album was subsequently re-released in 1999 by Jeepster Records. The cover photograph was taken by Stuart Murdoch, and features Joanne Kenney - the same model who appeared on the cover of the Dog on Wheels EP.\nThe album is named after a song that didn\'t end up making the cut – an instrumental that was later performed numerous times on Belle & Sebastian\'s early tours. <a href="http://www.last.fm/music/Belle+and+Sebastian/Tigermilk">Read more on Last.fm</a>.',
          content:
            'Tigermilk is the 1996 debut album from Scottish pop group Belle & Sebastian. Originally given a limited release (1,000 copies) by Electric Honey, the album was subsequently re-released in 1999 by Jeepster Records. The cover photograph was taken by Stuart Murdoch, and features Joanne Kenney - the same model who appeared on the cover of the Dog on Wheels EP.\nThe album is named after a song that didn\'t end up making the cut – an instrumental that was later performed numerous times on Belle & Sebastian\'s early tours. All of the songs on the album were written by Stuart Murdoch between 1993 and 1996, and originally performed solo on the Glasgow open mic circuit. Though he performs on the album, trumpet player Mick Cooke was not yet an official member of the band.\nPitchfork Media included "The State I Am In" at number 17 on their Top 200 Tracks of the 90s.[6] <a href="http://www.last.fm/music/Belle+and+Sebastian/Tigermilk">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
        },
