          summary:
            'Umskiptar (Old Norse for Metamorphosis) is the tenth studio album by Burzum, released on 21 May 2012 through Byelobog Productions. It has been described by Varg Vikernes as a "return to the roots", with a priority on atmosphere. The album\'s lyrics are taken from an Old Norse poem entitled Völuspá. The album was leaked two months before its release date, with Vikernes stating in an interview that it was leaked by a former PR agent who sent advance copies of Umskiptar to leftist extremist magazines. <a href="http://www.last.fm/music/Burzum/Umskiptar">Read more on Last.fm</a>.',
