          summary:
            'The mixtape was released for free on April 25, 2011 through the group\'s official website, thirdworlds.net. It was simultaneously released through iTunes. The track "Guillotine" was released through iTunes on August 3, 2011. "Guillotine" has become the band\'s most recognized song, with over one million YouTube views on their music video as of October 2, 2012. Other tracks released as music videos include "Known For It", "Culture Shock", "Lord of the Game", "Spread Eagle Cross the Block", "Takyon (Death Yon)", and "Beware". <a href="http://www.last.fm/music/Death+Grips/Exmilitary">Read more on Last.fm</a>.',
          content:
            'The mixtape was released for free on April 25, 2011 through the group\'s official website, thirdworlds.net. It was simultaneously released through iTunes. The track "Guillotine" was released through iTunes on August 3, 2011. "Guillotine" has become the band\'s most recognized song, with over one million YouTube views on their music video as of October 2, 2012. Other tracks released as music videos include "Known For It", "Culture Shock", "Lord of the Game", "Spread Eagle Cross the Block", "Takyon (Death Yon)", and "Beware".\n\nThe cover of the album is somewhat of a mystery, even to members of the band. According to Flatlander, "That’s a photograph that one of our members carried in their wallet for roughly 10 years straight. It’s a power object." This suggests that the image had no personal meaning to any of the members of the band, but was rather an artifact that ended up being an image that they defined themselves by to some degree. There has been speculations by fans of the band that the man on the cover of the album is an aboriginal Australian man and that the photograph could have originated from a National Geographic article, though this is widely based on speculation.\n\nThe album was later released exclusively through the band\'s website in vinyl and cassette format.  It was also removed from iTunes. <a href="http://www.last.fm/music/Death+Grips/Exmilitary">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
